<!DOCTYPE html>
<html lang="en">
  <head>
    <!-- Required meta tags -->
    <meta charset="utf-8" />
    <style>
      /* Primary #ad3fa9 */
      /* BG Dark #050407 */
      * {
        -webkit-app-region: drag;
      }
      body {
        background-color: #050407;
        color: white;
        font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
        -webkit-user-select: none;
        -webkit-app-region: drag;
        user-select: none !important;
      }
      .logo {
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
      }
      .message2 {
        position: absolute;
        bottom: 10px;
        left: 10px;
        font-size: small;
      }
      .by {
        position: absolute;
        bottom: 10px;
        right: 10px;
        font-size: x-small;
        text-decoration: solid;
        color: white;
      }
      .message1 {
        position: absolute;
        top: 10px;
        left: 10px;
        font-size: x-small;
        font-weight: bold;
        background-color: #ad3fa9;
        padding: 5px;
        border-radius: 4px;
      }
      @keyframes flickerAnimation {
        0% {
          opacity: 1;
        }
        50% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      @-o-keyframes flickerAnimation {
        0% {
          opacity: 1;
        }
        50% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      @-moz-keyframes flickerAnimation {
        0% {
          opacity: 1;
        }
        50% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      @-webkit-keyframes flickerAnimation {
        0% {
          opacity: 1;
        }
        50% {
          opacity: 0;
        }
        100% {
          opacity: 1;
        }
      }
      .animate-flicker {
        -webkit-animation: flickerAnimation 3s infinite;
        -moz-animation: flickerAnimation 3s infinite;
        -o-animation: flickerAnimation 3s infinite;
        animation: flickerAnimation 3s infinite;
      }
    </style>
